import React, { Component } from 'react';

class Register extends Component {
    constructor(props) {
        super(props);

        this.state = {
            newStudent: {
                id: '',
                firstName: '',
                lastName: '',
                age: '',
                nationality: '',
            },
        }
    }

    render() {
        return {

        }
    }
}
